(171, 'nimble_api_news_data', 'a:4:{i:0;a:4:{s:5:\"title\";s:65:\"Hueman free and pro, new release fixing an issue with text widget\";s:7:\"excerpt\";s:326:\"Dear Hueman theme users, This new release has been successfully tested with the latest WordPress 5.2.3 Here&#8217;s the changelog for Hueman free ( v3.4.29 ) and pro ( v1.1.28 ) : fixed : pro related posts grid that could break on mobile devices fixed : add do_shortcode filter cb to widget_text filter hook only if [&hellip;]\";s:7:\"created\";s:19:\"2019-09-10 10:54:39\";s:3:\"url\";s:92:\"https://presscustomizr.com/hueman-free-and-pro-new-release-fixing-an-issue-with-text-widget/\";}i:1;a:4:{s:5:\"title\";s:50:\"Better keyboard navigation for Hueman free and pro\";s:7:\"excerpt\";s:337:\"Dear Hueman theme users, This new release implements an enhanced keyboard navigation and fixes a few minor bugs reported in our support helpdesks. It has been successfully tested with the latest WordPress 5.2.2. Here&#8217;s the changelog for Hueman free ( v3.4.27 ) and pro ( v1.1.25 ) : fixed : admin notice style on mobile. [&hellip;]\";s:7:\"created\";s:19:\"2019-08-27 18:58:06\";s:3:\"url\";s:78:\"https://presscustomizr.com/better-keyboard-navigation-for-hueman-free-and-pro/\";}i:2;a:4:{s:5:\"title\";s:68:\"A few minor bugs fixes in Hueman free v3.4.26 and Hueman Pro v1.1.25\";s:7:\"excerpt\";s:347:\"Dear Hueman theme users, This new release fixes a few minor bugs reported in our support helpdesk. It has been successfully tested with the latest WordPress 5.2.2. Here&#8217;s the changelog : fixed : styling issue for comment form cookies consent not correctly displayed. fixed : linkedIn icon not displayed because of a js error fixed [&hellip;]\";s:7:\"created\";s:19:\"2019-07-19 16:46:41\";s:3:\"url\";s:96:\"https://presscustomizr.com/a-few-minor-bugs-fixes-in-hueman-free-v3-4-26-and-hueman-pro-v1-1-25/\";}i:3;a:4:{s:5:\"title\";s:67:\"🎁 Nimble Builder now includes a wonderful carousel builder !🎉\";s:7:\"excerpt\";s:358:\"Dear Nimble Builder users, Say hello to the new Carousel Module joining Nimble builder&#8217;s module collection! This is a breakthrough feature allowing you to build a carousel in real-time preview from the WordPress live customizer. Quick video tour A video is always better than a thousand words, so let&#8217;s take a quick tour. &nbsp; Adding [&hellip;]\";s:7:\"created\";s:19:\"2019-07-19 16:04:49\";s:3:\"url\";s:110:\"https://presscustomizr.com/%f0%9f%8e%81-nimble-builder-now-includes-a-wonderful-carousel-builder-%f0%9f%8e%89/\";}}', 'no'),
