0;a:5:{s:4:\"data\";s:53:\"http://feedproxy.google.com/~r/W3EDGE/~3/LG6fkVvlFCQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:141:\"https://www.w3-edge.com/weblog/2019/10/cache-busting-in-w3tc-how-to-force-your-visitors-to-see-your-themes-updated-js-and-css-files/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Oct 2019 16:04:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=14069\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:343:\"&#160; Sometimes modifications to existing .js and .css files are not reflected for users visiting your website. This occurs because those files have been cached in the user’s browser from a previous visit and the cached version is served instead of the most recent version. The expiration of this cache is called time to live, or [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Marko\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3761:\"<p>&nbsp;</p>\n<p><strong><span style=\"font-weight: 400;\">Sometimes modifications to existing .js and .css files are not reflected for users visiting your website. This occurs because those files have been cached in the user’s browser from a previous visit and the cached version is served instead of the most recent version. The expiration of this cache is called time to live, or TTL and it is associated with this local cache in your browser, which is why it will show the old version until this length of time has passed. To see the correct version of the files, the user has to either clear the browser’s local cache &amp; reload the page or do a hard refresh of the page by pressing Ctrl+F5 to ensure their browser is using the latest file versions.</span></strong></p>\n<p>When a user tries to access the URL, and the browser starts fetching the page data, it sees that it already has the page’s stylesheet E.G. style.css, and  says “Wait!, I already have this file cached, so I don’t need to fetch it again and can just present that to the visitor”. And the Browser has a point!</p>\n<h3>What is Cache Busting?</h3>\n<p>Asking each and every user to clear their browser cookies or do a hard refresh is not reasonable and leads to frustrating user experience. To remedy this, we can use a technique known as Cache Busting. Cache Busting works by appending a unique query string to the path of the .js or .css file that tells the browser there is a new file to add to the cache memory.  When the browser loads a page using these query strings it downloads any unrecognized files and displays them for the visitor.</p>\n<h3>How can I fix this?</h3>\n<p>You can use any unique query string you want to bust the browser cache, but the easiest way to guarantee a unique string is to use version numbers.</p>\n<p>For example:</p>\n<p>Let’s say you make some changes within your theme’s main JS file:</p>\n<p>/mywebsite/wp-content/themes/mytheme/mytheme.js</p>\n<p>After updating the file simply add a version number query string ?v=1.0</p>\n<p>/mywebsite/wp-content/themes/mytheme/mytheme.js?v=1.0</p>\n<p>This way when the browser will see the updated JS as a new .js file which is not cached. So it will generally force the browser to update the JavaScript/stylesheet. So, each time you update your JS/CSS on the server, you can incrementally update your version number so it busts the previously saved browser cache.</p>\n<p>You can accomplish this when you enqueue your script by adding an argument for the version, for example:\n</p><pre class=\"crayon-plain-tag\">$version = “1.0”;\nwp_enqueue_script( “my_script”, $source, $dependencies, $version, $in_footer );</pre><p>\n&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=LG6fkVvlFCQ:aIOH5D6Uy_4:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=LG6fkVvlFCQ:aIOH5D6Uy_4:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=LG6fkVvlFCQ:aIOH5D6Uy_4:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=LG6fkVvlFCQ:aIOH5D6Uy_4:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=LG6fkVvlFCQ:aIOH5D6Uy_4:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=LG6fkVvlFCQ:aIOH5D6Uy_4:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=LG6fkVvlFCQ:aIOH5D6Uy_4:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=LG6fkVvlFCQ:aIOH5D6Uy_4:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/LG6fkVvlFCQ\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:137:\"https://www.w3-edge.com/weblog/2019/10/cache-busting-in-w3tc-how-to-force-your-visitors-to-see-your-themes-updated-js-and-css-files/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:132:\"https://www.w3-edge.com/weblog/2019/10/cache-busting-in-w3tc-how-to-force-your-visitors-to-see-your-themes-updated-js-and-css-files/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"WordPress 5.3 Beta 3 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://feedproxy.google.com/~r/W3EDGE/~3/HKB4oEEqJ3U/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://www.w3-edge.com/weblog/2019/10/wordpress-5-3-beta-3-released/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 10 Oct 2019 14:22:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=14063\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:371:\"&#160; WordPress 5.3, scheduled to be released on November 12, and contains numerous improvements for site performance and user experience. Server-Side Block API PHP enthusiasts (and JavaScript haters) will be glad to know that there is now a server-side API for creating blocks in the WordPress Block Editor (Gutenberg). When asked about the performance impact [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Marko\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5149:\"<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">WordPress 5.3, scheduled to be released on November 12, and contains numerous improvements for site performance and user experience.</span></p>\n<h2><span style=\"font-weight: 400;\">Server-Side Block API</span></h2>\n<p><span style=\"font-weight: 400;\">PHP enthusiasts (and JavaScript haters) will be glad to know that there is now a </span><a href=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/\"><span style=\"font-weight: 400;\">server-side API for creating blocks</span></a><span style=\"font-weight: 400;\"> in the WordPress Block Editor (Gutenberg). When </span><a href=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/#comment-36997\"><span style=\"font-weight: 400;\">asked about the performance impact</span></a><span style=\"font-weight: 400;\"> of registering new blocks this way, Core Contributor </span><a href=\"https://profiles.wordpress.org/jorgefilipecosta/\"><span style=\"font-weight: 400;\">Jorge Costa</span></a><span style=\"font-weight: 400;\"> suspects that the impact should be negligible unless compared to a JavaScript file that is registering a large number of new blocks, which could be cached by the browser:</span></p>\n<p><i><span style=\"font-weight: 400;\">For most cases, the performance should be equivalent. The PHP code dynamically generates an inline script with the equivalent JavaScript code to register a block style and generates an inline style with the classes. If many block styles are being registered having a single JavaScript file that registers all the styles and a single stylesheet that includes the styles may be more performant than registering the styles with PHP. In that case, the JavaScript and CSS files will probably be cached by the browsers while for inline scripts/styles it is not possible to take advantage of caching.</span></i></p>\n<h2><span style=\"font-weight: 400;\">Better Large Image Uploads</span></h2>\n<p><span style=\"font-weight: 400;\">An update to the WordPress REST API will solve a major pain-point for many users— </span><a href=\"https://core.trac.wordpress.org/ticket/47987\"><span style=\"font-weight: 400;\">better handling of large image uploads.</span></a><span style=\"font-weight: 400;\"> Previously, if the server returned a 500 error at any point during the upload process, the upload would fail. Now, the request will automatically reconnect and attempt the upload again, as well as generate the attachment sizes at the very end of the request.</span></p>\n<p><span style=\"font-weight: 400;\">In another improvement to the REST API, you can now use </span><a href=\"https://make.wordpress.org/core/2019/10/03/wp-5-3-supports-object-and-array-meta-types-in-the-rest-api/\"><span style=\"font-weight: 400;\">Objects and Arrays to create Post Meta-based Gutenberg blocks.</span></a></p>\n<h2><span style=\"font-weight: 400;\">Twenty Twenty Theme</span></h2>\n<p><span style=\"font-weight: 400;\">The Twenty Twenty theme has excellent performance according to our tests. The developers have included the </span><a href=\"https://rsms.me/inter/\"><span style=\"font-weight: 400;\">Inter</span></a><span style=\"font-weight: 400;\"> typeface, which includes all of its weights and variations in just two files—  which are </span><a href=\"https://core.trac.wordpress.org/ticket/46170\"><span style=\"font-weight: 400;\">served directly from the website rather than using cross-domain requests.</span></a></p>\n<h2><span style=\"font-weight: 400;\">Modernizing the Date/Time API</span></h2>\n<p><span style=\"font-weight: 400;\">The WordPress Date/Time component has historically relied on the sum of the Unix timestamp and a time zone offset, which caused a great deal of confusion since the inline documentation referred to it as simply a Unix timestamp. Developers would need to account for this difference when comparing two timestamps against each other.</span></p>\n<p>The new API allows developers to fetch a timestamp as a true Unix time or a DateTimeImmutable object, with methods to set timezone offsets in a reliable manner.</p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HKB4oEEqJ3U:cdpwWVnaLlY:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HKB4oEEqJ3U:cdpwWVnaLlY:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HKB4oEEqJ3U:cdpwWVnaLlY:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HKB4oEEqJ3U:cdpwWVnaLlY:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HKB4oEEqJ3U:cdpwWVnaLlY:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HKB4oEEqJ3U:cdpwWVnaLlY:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HKB4oEEqJ3U:cdpwWVnaLlY:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HKB4oEEqJ3U:cdpwWVnaLlY:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/HKB4oEEqJ3U\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://www.w3-edge.com/weblog/2019/10/wordpress-5-3-beta-3-released/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://www.w3-edge.com/weblog/2019/10/wordpress-5-3-beta-3-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"W3 Total Cache v0.10.1 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://feedproxy.google.com/~r/W3EDGE/~3/HYMnNP1G4Sw/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-1-released/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Sep 2019 11:47:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=14059\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:398:\"Thank you for using W3 Total Cache! With this minor release, we fixed slowdown in Memcached engine, Purge Cache menu links so they flush current blog in WPMU, and fixed am an error during upgrade, &#8220;Call to undefined method W3TC Util_Content::is_database_error&#8221;.  We’ve also updated Redis cache engine to avoid &#8220;Function Redis::delete() is deprecated&#8221; warning In [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Marko\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2554:\"<p><span style=\"font-weight: 400;\">Thank you for using W3 Total Cache!</span></p>\n<p>With this minor release, we fixed slowdown in Memcached engine, Purge Cache menu links so they flush current blog in WPMU, and fixed am an error during upgrade, &#8220;Call to undefined method W3TC Util_Content::is_database_error&#8221;.  We’ve also updated Redis cache engine to avoid &#8220;Function Redis::delete() is deprecated&#8221; warning</p>\n<p><span style=\"font-weight: 400;\">In our public repository on </span><a href=\"https://github.com/W3EDGE/w3-total-cache\"><span style=\"font-weight: 400;\">GitHub</span></a><span style=\"font-weight: 400;\">, you can review our source code, post issues, and even submit Pull requests. You are welcome to join us there, and we really appreciate all users that have contributed, both past and present.</span></p>\n<p><span style=\"font-weight: 400;\">We are always looking for ways to improve W3 Total Cache with new features, UI improvements, and of course, improvements to the user experience. If you like what we have done, please be sure to take some time and rate our plugin </span><a href=\"https://wordpress.org/plugins/w3-total-cache/#reviews\"><span style=\"font-weight: 400;\">on the WordPress Plugin Repository</span></a><span style=\"font-weight: 400;\">.</span></p>\n<p><span style=\"font-weight: 400;\">Once again, we are sending a big thanks to all of our supporters, including those who are active in the forums helping end-users. </span></p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HYMnNP1G4Sw:EidkvEcFSj0:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HYMnNP1G4Sw:EidkvEcFSj0:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HYMnNP1G4Sw:EidkvEcFSj0:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HYMnNP1G4Sw:EidkvEcFSj0:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HYMnNP1G4Sw:EidkvEcFSj0:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HYMnNP1G4Sw:EidkvEcFSj0:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=HYMnNP1G4Sw:EidkvEcFSj0:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=HYMnNP1G4Sw:EidkvEcFSj0:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/HYMnNP1G4Sw\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-1-released/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-1-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"W3 Total Cache v0.10.0 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://feedproxy.google.com/~r/W3EDGE/~3/2q5-kXh7vJM/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-0-released/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Sep 2019 14:28:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=14056\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:349:\"Thank you for using W3 Total Cache! The newest update for W3 Total Cache is here and we will continue to deliver more speed for your WordPress websites while we continually improve the user experience. In this release, we’ve added a new statistics component for pro users, redirects by using safer wp_safe redirect, .htaccess usage when [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Marko\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3215:\"<p><span style=\"font-weight: 400;\">Thank you for using W3 Total Cache!</span></p>\n<p>The newest update for W3 Total Cache is here and we will continue to deliver more speed for your WordPress websites while we continually improve the user experience.</p>\n<p><span style=\"font-weight: 400;\">In this </span><a href=\"https://wordpress.org/plugins/w3-total-cache/#developers\"><span style=\"font-weight: 400;\">release</span></a><span style=\"font-weight: 400;\">, we’ve added a new statistics component for pro users, redirects by using safer wp_safe redirect, .htaccess usage when page cache does not require it, protection of unexpected values in global variables, and improved support for CloudFront distributions with multiple origins. We’ve also added support for the Memcached binary protocol when available, more Amazon S3 regions, and caching for webp MIME type. </span></p>\n<p><span style=\"font-weight: 400;\">Additionally, we have fixed some bugs with the usage of base URL with minify, S3 + CloudFront URLs when CNAMEs not used, and mixing the content of sync &amp; async scripts with minify.</span></p>\n<p><span style=\"font-weight: 400;\">In our public repository on </span><a href=\"https://github.com/W3EDGE/w3-total-cache\"><span style=\"font-weight: 400;\">GitHub</span></a><span style=\"font-weight: 400;\">, you can review our source code, post issues, and even submit Pull requests. You are welcome to join us there, and we really appreciate all users that have contributed, both past and present.</span></p>\n<p><span style=\"font-weight: 400;\">We are always looking for ways to improve W3 Total Cache with new features, UI improvements, and of course, improvements to the user experience. If you like what we have done, please be sure to take some time and rate our plugin </span><a href=\"https://wordpress.org/plugins/w3-total-cache/#reviews\"><span style=\"font-weight: 400;\">on the WordPress Plugin Repository</span></a><span style=\"font-weight: 400;\">.</span></p>\n<p><span style=\"font-weight: 400;\">Once again, we are sending a big thanks to all of our supporters, including those who are active in the forums helping end-users. </span></p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=2q5-kXh7vJM:jnLxOSHqQJ4:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=2q5-kXh7vJM:jnLxOSHqQJ4:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=2q5-kXh7vJM:jnLxOSHqQJ4:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=2q5-kXh7vJM:jnLxOSHqQJ4:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=2q5-kXh7vJM:jnLxOSHqQJ4:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=2q5-kXh7vJM:jnLxOSHqQJ4:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=2q5-kXh7vJM:jnLxOSHqQJ4:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=2q5-kXh7vJM:jnLxOSHqQJ4:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/2q5-kXh7vJM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-0-released/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://www.w3-edge.com/weblog/2019/09/w3-total-cache-v0-10-0-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"W3 Total Cache v0.9.7.5 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link