re speed for your websites and better user experience. With this </span><span style=\"font-weight: 400;\"><a href=\"https://wordpress.org/plugins/w3-total-cache/#developers\">release</a>,</span><span style=\"font-weight: 400;\"> we’ve Updated AWS library due to the deprecation of older API versions scheduled on June 6, 2019, and added support of set_sql_mode by dbcluster. We’ve fixed the PHP warning when remote service cannot be loaded, PHP warnings on the support page and improved support for a web server running on non-default port with disk-enhanced and menu icons.</span></p>\n<p><span style=\"font-weight: 400;\">In our public repository on </span><span style=\"font-weight: 400;\"><a href=\"https://github.com/W3EDGE/w3-total-cache\">GitHub</a>,</span><span style=\"font-weight: 400;\"> you can review our code, post issues, and Pull requests, and you are welcome to join us there.</span></p>\n<p><span style=\"font-weight: 400;\">We are always looking to improve W3 Total Cache with new features and UI improvements and of course, fixes and improvements for improved user experience so make sure to take some time and rate our plugin </span><a href=\"https://wordpress.org/plugins/w3-total-cache/#reviews\"><span style=\"font-weight: 400;\">here</span></a><span style=\"font-weight: 400;\">.</span></p>\n<p><span style=\"font-weight: 400;\">Again, big thanks to all of our supporters, including those who are active in the forums helping end users. </span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=jc1p3zDrykc:MFylJnQRcbs:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=jc1p3zDrykc:MFylJnQRcbs:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=jc1p3zDrykc:MFylJnQRcbs:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=jc1p3zDrykc:MFylJnQRcbs:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=jc1p3zDrykc:MFylJnQRcbs:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=jc1p3zDrykc:MFylJnQRcbs:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=jc1p3zDrykc:MFylJnQRcbs:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=jc1p3zDrykc:MFylJnQRcbs:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/jc1p3zDrykc\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://www.w3-edge.com/weblog/2019/06/w3-total-cache-v0-9-7-5-released/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://www.w3-edge.com/weblog/2019/06/w3-total-cache-v0-9-7-5-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"W3 Total Cache v0.9.7.4 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://feedproxy.google.com/~r/W3EDGE/~3/wkPO0kdY-AA/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://www.w3-edge.com/weblog/2019/05/w3-total-cache-v0-9-7-4-released/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 08 May 2019 15:34:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=14042\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:328:\"Thanks for using W3 Total Cache! First, we want to thank all of you for bringing bugs and issues to our attention. This is helping us to fix and improve the W3 Total Cache to user satisfaction. In this release we improved security on calls to Opcache flush, cache delivery of /feed URLs, purging of the current page [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Marko\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3046:\"<p>Thanks for using W3 Total Cache!</p>\n<p><span style=\"font-weight: 400;\">First, we want to thank all of you for bringing bugs and issues to our attention. This is helping us to fix and improve the W3 Total Cache to user satisfaction. </span><span style=\"font-weight: 400;\">In this </span><a href=\"https://wordpress.org/plugins/w3-total-cache/#developers\" target=\"_blank\"><span style=\"font-weight: 400;\">release</span></a><span style=\"font-weight: 400;\"> we improved security on calls to Opcache flush, cache delivery of /feed URLs, purging of the current page by using post_id instead of URL and minification of files in environments running on non-default ports.</span></p>\n<p>We’ve also added fixes for database cluster in WordPress 5.1, minification in multisite when URLs were set to root-blog based URL, undefined w3tc_ga issue, warning caused by user agent theme change used, 404 in multisite caused by subdirectory issue and PHP warning when Redis integration not configured correctly</p>\n<p><span style=\"font-weight: 400;\">Make sure to visit our public repository on </span><a href=\"https://github.com/W3EDGE/w3-total-cache\"><span style=\"font-weight: 400;\">GitHub</span></a><span style=\"font-weight: 400;\"> where you can review our code, post issues, and Pull requests.</span></p>\n<p>In future releases, you can expect a lot of new features and UI improvements and of course, fixes and improvements for improved user experience</p>\n<p><span style=\"font-weight: 400;\">A big thanks to all of our supporters, including those who are active in the forums helping</span><span style=\"font-weight: 400;\"> end users</span><span style=\"font-weight: 400;\">. Please take some time and rate our plugin</span><a href=\"https://wordpress.org/support/plugin/w3-total-cache/reviews/\"> <span style=\"font-weight: 400;\">here</span></a><span style=\"font-weight: 400;\">. Every feedback and every issue reported is helping us continue offering a top-notch product.</span></p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=wkPO0kdY-AA:8rqohLOTz0k:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=wkPO0kdY-AA:8rqohLOTz0k:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=wkPO0kdY-AA:8rqohLOTz0k:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=wkPO0kdY-AA:8rqohLOTz0k:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=wkPO0kdY-AA:8rqohLOTz0k:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=wkPO0kdY-AA:8rqohLOTz0k:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=wkPO0kdY-AA:8rqohLOTz0k:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=wkPO0kdY-AA:8rqohLOTz0k:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/wkPO0kdY-AA\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://www.w3-edge.com/weblog/2019/05/w3-total-cache-v0-9-7-4-released/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://www.w3-edge.com/weblog/2019/05/w3-total-cache-v0-9-7-4-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lan