_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1888:\"<p>Thanks for using W3 Total Cache! We are proud to announce that we released the latest build of W3 Total Cache with support from various dedicated contributors (<a href=\"https://github.com/amiga-500\" target=\"_blank\">amiga-500</a> and <a href=\"https://github.com/nigrosimone\" target=\"_blank\">nigrosimone</a>) and a new partner, Swarmify!</p>\n<p>This release includes various improvements to increase compatibility and the reliability of the plugin. And we&#8217;re very excited to announce that for those of you that produce video content, you can also us Swarmify to optimize the user experience of that content. <a href=\"https://swarmify.com/landing/w3tc\" target=\"_blank\">Check them out to learn more</a>!</p>\n<p>As always, thanks to all of our supporters, including those who are active in the forums helping end users.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=fIG7CASfaY0:1kcP9FxMjBI:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=fIG7CASfaY0:1kcP9FxMjBI:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=fIG7CASfaY0:1kcP9FxMjBI:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=fIG7CASfaY0:1kcP9FxMjBI:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=fIG7CASfaY0:1kcP9FxMjBI:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=fIG7CASfaY0:1kcP9FxMjBI:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=fIG7CASfaY0:1kcP9FxMjBI:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=fIG7CASfaY0:1kcP9FxMjBI:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img