p 2016 05:22:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"W3 Total Cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://www.w3-edge.com/?p=13994\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:357:\"As always, security is very important to us. A few folks from the community came forward and called those issues to our attention and helped us test those fixes. Specifically, SecuPress team for testing the various security fixes: Security Token ByPass, Arbitrary File Upload, Arbitrary File Download, Arbitrary PHP Eval and the XSS vector. Thanks [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Frederick Townes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2350:\"<p>As always, security is very important to us. A few folks from the community came forward and called those issues to our attention and helped us test those fixes. Specifically, <a href=\"https://secupress.me/\">SecuPress</a> team for testing the various security fixes: Security Token ByPass, Arbitrary File Upload, Arbitrary File Download, Arbitrary PHP Eval and the XSS vector. Thanks to those that continue to be supportive in their efforts and kind words.</p>\n<p>This release has some cosmetic bugs in the latest version of WordPress, but our test suite shows that core functionality is working as intended. Having said that, I&#8217;m sure there are other bugs and bumps in the upgrade process &#8211; we&#8217;d love to learn about those, so we can push a follow-up release. Thanks in advance for reporting any issues you find. Hopefully, you find them in a staging area and not in your production site.</p>\n<p>There are a couple of highlights for this build aside from the security fixes including new functionality for Pro subscribers, new caching engines, new extensions, new integrations and increased interoperability. Please <a href=\"https://wordpress.org/plugins/w3-total-cache/changelog/\">check out the changelog</a> for specifics.</p>\n<p>Thanks for using W3 Total Cache!</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=lyRsLqHF6Kg:1zqu8I3b6_s:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=lyRsLqHF6Kg:1zqu8I3b6_s:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=lyRsLqHF6Kg:1zqu8I3b6_s:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=lyRsLqHF6Kg:1zqu8I3b6_s:F7zBnMyn0Lo\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=lyRsLqHF6Kg:1zqu8I3b6_s:F7zBnMyn0Lo\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=lyRsLqHF6Kg:1zqu8I3b6_s:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?d=qj6IDK7rITs\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/W3EDGE?a=lyRsLqHF6Kg:1zqu8I3b6_s:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/W3EDGE?i=lyRsLqHF6Kg:1zqu8I3b6_s:gIN9vFwOqvQ\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/W3EDGE/~4/lyRsLqHF6Kg\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4: