_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Sat, 19 Oct 2019 08:17:22 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wordpress.org/support/topic/testing-need-to-disable-w3-total-cache-temporarily/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:712:\"<p>Replies: 1</p>\n						<p>We have W3 Total Cache and Amazon CDN</p>\n<p>There is an ad rotating plugin I want to try but I am told that the W3 Total Cache plugin will keep it from working without an additional plugin to install.</p>\n<p>What I would like to do is disable temporarily, or pause, W3 Total Cache to see how this rotating plugin works and if it does work then we would install this additional plugin.  But I don&#8217;t want to mess up my website.  </p>\n<p>So what would be the best way to see my website without W3 Total Cache in place so I can check out this ad rotating plugin?  </p>\n<p>Thanks.</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/qgii-1_xBtM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wordpress.org/support/topic/testing-need-to-disable-w3-total-cache-temporarily/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:0:\"\";s:7