oad time under 3 seconds.</p>\n<p>However, now when I check GTmetrix, I am receiving a high priority alert to &#8216;defer parsing of JavaScript.&#8217; All of the items listed under this follow this format: &#8220;website.com/wp-content/cache/minify/XXXXX.js&#8221;</p>\n<p>Using the &#8216;auto&#8217; minify setting has also made Avada theme&#8217;s Fusion Builder Live unusable. If I change the minify setting to &#8216;manual&#8217; I am able to use the theme&#8217;s editor again, but the load time goes back up to 6+ seconds and the page score goes back down.</p>\n<p>I am also currently getting support from Avada Support about this topic, and they asked if I could contact you about the issue. I apologize in advance, as I am not the most knowledgeable about these technical issues.</p>\n<p>Thank you,<br />\nSteph</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/3EAJD7ZM4HQ\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"skg5353\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"https://wordpress.org/support/topic/minify-setting-causing-defer-parsing-of-javascript-alert/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:158:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;fonts.googleapis.com blocks rendering\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";