st changes.</p>\n<p>Only way to see latest changes is to turn off the minification in settings of W3 Total Cache, then we can see site without issues.</p>\n<p>Thank you for your response in advance.</p>\n<p>Regards,<br />\nDavid Rychlý</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/OV6g6Ppw7Qs\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"David Rychlý\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://wordpress.org/support/topic/issue-with-minification-of-js/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:153:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;W3TC Page Cache + AWS CloudFront\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/jgDhTAVeUvU/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Tue, 15 Oct 2019 15:44:40 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wordpress.org/support/topic/w3tc-page-cache-aws-cloudfront/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1232:\"<p>Replies: 2</p>\n						<p>Does W3 Total Cache built-in CloudFront option support the delivery of all existing WP assets to CloudFront + S3 combo?</p>\n<p>I had my setup per Amazon&#8217;s recommendation per the link below and used WP Offload Media to sync media library to S3 to reduce the load on my EC2. Soon to realize that all existing Page Cache by W3TC / theme customization does not sync up to my S3. In another word, only media worked for now due to the limitation of WP Offload Media.</p>\n<p><a href=\"https://aws.amazon.com/blogs/networking-and-content-delivery/how-to-accelerate-your-wordpress-site-with-amazon-cloudfront/\" rel=\"nofollow\">https://aws.amazon.com/blogs/networking-and-content-delivery/how-to-accelerate-your-wordpress-site-with-amazon-cloudfront/</a></p>\n<p>Will W3TC CDN CloudFront option update all necessary assets on S3 and delivery my contents via CloudFront? (themes/css/js/uploads/page cache/object cache)</p>\n<p>Current AWS setup is with<br />\n&#8211; EC2 x2 (sync is cpu intensive / hence my intention to move most of everything to s3)<br />\n&#8211; RDS<br />\n&#8211; S3<br />\n&#8211; CloudFront</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/jgDhTAVeUvU\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"kenwong87\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wordpress.org/support/topic/w3tc-page-cache-aws-cloudfront/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"Upload new attachments only to CDN\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/lFIf4z1N39o/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Tue, 15 Oct 2019 13:21:47 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/support/topic/upload-new-attachments-only-to-cdn/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:947:\"<p>Replies: 5</p>\n						<p>Hi,<br />\nI uploaded my initial media files to amazon CDN without any issues and everything works great.<br />\nNow I added a thousands more media files to my website, and when I click on upload attachments, it displays the total number of my media files including the previously uploaded ones.</p>\n<p>How can I upload only the new attachments? Obviously I don&#8217;t want to push my whole media library every time I add a new image.</p>\n<p>Thank you for your help!</p>\n\n\n<ul id=\"bbp-topic-revision-log-12032822\" class=\"bbp-topic-revision-log\">\n\n	<li id=\"bbp-topic-revision-log-12032822-item-12032829\" class=\"bbp-topic-revision-log-item\">\n		This topic was modified 4 days, 14 hours ago by <a href=\"https://wordpress.org/support/users/jojojijijojo/\" title=\"View jojojijijojo&#039;s profile\">jojojijijoj