			<p>Hi,<br />\nI have setup an amazon cloudfront along with IAM and s3 bucket, and entered the keys and alternative domain in the CDN settings.<br />\nHowever Im getting this error every time I try to run the test:<br />\n&#8220;Error: Error executing &#8220;ListDistributions&#8221; on &#8220;https://cloudfront.amazonaws.com/2018-11-05/distribution &#8230;&#8221;<br />\nAnyone knows what might be causing this?<br />\nI have also given full s3 access to the created IAM user.</p>\n\n\n<ul id=\"bbp-topic-revision-log-12024092\" class=\"bbp-topic-revision-log\">\n\n	<li id=\"bbp-topic-revision-log-12024092-item-12024123\" class=\"bbp-topic-revision-log-item\">\n		This topic was modified 1 week ago by <a href=\"https://wordpress.org/support/users/jojojijijojo/\" title=\"View jojojijijojo&#039;s profile\">jojojijijojo</a>.\n	</li>\n\n</ul><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/DoW50VkulVk\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"jojojijijojo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wordpress.org/support/topic/amazon-cloudfront-permission-issues/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"CORS header ‘Access-Control-Allow-Origin’ missing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/CITn7kdyJU0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Sat, 12 Oct 2019 08:55:57 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://wordpress.org/support/topic/cors-header-access-control-allow-origin-missing-2/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2923:\"<p>Replies: 3</p>\n						<p>I have installed W3 Total Cache but I’m getting CORS error, on firefox and chrome:</p>\n<p>Access to font at &#8216;https://cdn.domain.com/wp-content/themes/oceanwp/assets/fonts/fontawesome/fontawesome-webfont.woff2?v=4.7.0&#8217; from origin &#8216;https://domain.com&#8217; has been blocked by CORS policy: No &#8216;Access-Control-Allow-Origin&#8217; header is present on the requested resource.</p>\n<p>My htaccess file have the proper data:<br />\nI have followed these instructions:</p>\n<p><a href=\"https://wordpress.org/support/topic/cors-header-access-control-allow-origin-missing/\" rel=\"nofollow\">https://wordpress.org/support/topic/cors-header-access-control-allow-origin-missing/</a></p>\n<p>and added this to the htaccess.php file:</p>\n<p>&lt;FilesMatch &#8220;\\.(ttf|otf|eot|woff|woff2|svg)$&#8221;&gt;<br />\n    &lt;IfModule mod_headers.c&gt;<br />\n        SetEnvIf Origin &#8220;http(s)?://(cdn|sub)\\.domain\\.com$&#8221; AccessControlAllowOrigin=$0<br />\n        Header add Access-Control-Allow-Origin %{AccessControlAllowOrigin}e env=AccessControlAllowOrigin<br />\n        Header merge Vary Origin<br />\n    &lt;/IfModule&gt;<br />\n&lt;/FilesMatch&gt;</p>\n<p>My htaccess file looks like this:</p>\n<p># BEGIN W3TC CDN</p>\n<p>&lt;IfModule mod_headers.c&gt;<br />\nHeader set Access-Control-Allow-Origin “*”<br />\n&lt;/IfModule&gt;<br />\n&lt;FilesMatch &#8220;\\.(ttf|otf|eot|woff|woff2|svg)$&#8221;&gt;<br />\n    &lt;IfModule mod_headers.c&gt;<br />\n        SetEnvIf Origin &#8220;http(s)?://(cdn|sub)\\.domain\\.com$&#8221; AccessControlAllowOrigin=$0<br />\n        Header add Access-Control-Allow-Origin %{AccessControlAllowOrigin}e env=AccessControlAllowOrigin<br />\n        Header merge Vary Origin<br />\n    &lt;/IfModule&gt;<br />\n&lt;/FilesMatch&gt;</p>\n<p># END W3TC CDN</p>\n<p>In addition I have allowed CORS on AWS S3 bucket and my S3 permissions looks like this:</p>\n<p>&lt;?xml version=&#8221;1.0&#8243; encoding=&#8221;UTF-8&#8243;?&gt;<br />\n&lt;CORSConfiguration xmlns=&#8221;http://s3.amazonaws.com/doc/2006-03-01/&#8221;&gt;<br />\n&lt;CORSRule&gt;<br />\n    &lt;AllowedOrigin&gt;<a href=\"https://*.domain.com&lt;/AllowedOrigin&#038;gt\" rel=\"nofollow\">https://*.domain.com&lt;/AllowedOrigin&#038;gt</a>;<br />\n    &lt;AllowedMethod&gt;GET&lt;/AllowedMethod&gt;<br />\n    &lt;AllowedMethod&gt;HEAD&lt;/AllowedMethod&gt;<br />\n    &lt;AllowedMethod&gt;DELETE&lt;/AllowedMethod&gt;<br />\n    &lt;AllowedMethod&gt;PUT&lt;/AllowedMethod&gt;<br />\n    &lt;AllowedMethod&gt;POST&lt;/AllowedMethod&gt;<br />\n    &lt;MaxAgeSeconds&gt;3000&lt;/MaxAgeSeconds&gt;<br />\n    &lt;AllowedHeader&gt;Authorization&lt;/AllowedHeader&gt;<br />\n&lt;/CORSRule&gt;<br />\n&lt;/CORSConfiguration&gt;</p>\n<p>Can you guide me to fix this problem ? In the meantime I have disabled the plugin.</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/CITn7kdyJU0\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"amandapandashop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://wordpress.org/support/topic/cors-header-access-control-allow-origin-missing-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:160:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;Old blog pages are not loading properly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/n9zWE8QAZUA/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Fri, 11 Oct 2019 07:15:38 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wordpress.org/support/topic/old-blog-pages-are-not-loading-properly/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:994:\"<p>Replies: 14</p>\n						<p>Hello,</p>\n<p>The cache on my blog page has an issue. When I click more than once on previous pages in the navigation, there&#8217;s a error message saying the page had to be reloaded and it redirects back to page 1. If I click again, the page won&#8217;t load at all.</p>\n<p>Funny thing, it does that with Safari, but not with Chrome.</p>\n<p>I&#8217;ve purged nginx server, all caches and my browsers caches numerous times.</p>\n<p>When I click on Purge current page, the message becomes There&#8217;s a recurring problem with the page : &#8230;/?w3tc_note=pgcache_purge_post </p>\n<p>I guess I did something wrong with the settings. However, the problem still shows up after returning to my back up.</p>\n<p>Also, maybe related, maybe not, I&#8217;ve had 404 errors coming from /cache/minify/24da7.default.include.786b3e.css and .js</p>\n<p>Thank you for your help!</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/n9zWE8QAZUA\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"LF\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wordpress.org/support/topic/old-blog-pages-are-not-loading-properly/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:163:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;Custom post type archives still not purged\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/Sx1bgI5seBk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Thu, 10 Oct 2019 13:47:51 PDT\";s:7:\"attribs\";a:0