:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:169:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;W3 Total Cache breaks Elementor Pro page Builder\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/A7KJ7MB8kEc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Wed, 09 Oct 2019 03:54:25 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wordpress.org/support/topic/w3-total-cache-breaks-elementor-pro-page-builder/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:636:\"<p>Replies: 1</p>\n						<p>I&#8217;m having an issue with your plugin, basically it messes up with the page CSS, inside Elementor the web looks fine but when the page is published looks without the proper CSS.</p>\n<p>I emailed Elementor&#8217;s support and after a few emails and test we identified that W3 Total Cache was causing the issue.</p>\n<p>Now the plugin is deactivated and the web looks fine, I&#8217;ll be happy to send you all the information you might need in order to fix this bug.</p>\n<p>Kind regards</p>\n<p>Guillermo </p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/A7KJ7MB8kEc\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"guillermop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wordpress.org/support/topic/w3-total-cache-breaks-elementor-pro-page-builder/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:157:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;Random issue: pages load VERY slowly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/6LqXcokUI4s/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Tue, 08 Oct 2019 23:26:48 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wordpress.org/support/topic/random-issue-pages-load-very-slowly-2/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2516:\"<p>Replies: 2</p>\n						<p>Dear Support,<br />\nI turn to you with a „mysterious” problem I can’t find any solution to. Do you think your plugin can be linked to this issue? On the page I mention (duotone.hu)<br />\n&#8211;	I use W3TC and Autoptimize together.<br />\n&#8211;	For years there was no such problem.</p>\n<p>The problem is that randomly a page of a site loads extremely slowly (0,5-1 minute!).<br />\n&#8211;	It doesn’t matter what the page contains, it can happen to any page.<br />\n&#8211;	Page speed tools show that the pages are healthy and very fast in general (GTMetrix,Webpagetest.org etc.). I can’t trigger/cause the problem to happen.<br />\n&#8211;	It also happens to pages that must be cached in the browser as I know it was previously visited.<br />\n&#8211;	I checked „compatibility check” on my site and saw that some server adjustments are needed for disk enhanced setting in Page Cache and Browser cache. So I turned to Basic but things got much worse&#8230; So I turned on disk enhanced again and wrote to the hosting provider to enable the needed settings. Their answer was that some are enabled, some are not provided on the server&#8230; However, compatibility check still says that mod_deflate and mod_env are not installed.<br />\n&#8211;	But it seems to me that this is not the real problem as the site worked perfectly with the abve settings for a couple of years.<br />\n&#8211;	On a forum site I got the advice to increase the time in W3TC cache preload setting because the site has few visitors – I did.<br />\n&#8211;	The hosting space is an SSL space which is really fast otherwise.<br />\n&#8211;	The site was moved to the new hosting provider in March but the problem started only about in July.<br />\n&#8211;	Also, in the past two months I sometimes receive 504 nginx gateway timeout errors on the backend, when updating a theme or some plugins (e.g. your plugin). Then, when I leave the plugin/theme page and go back later, it seems that the updating process was successful.<br />\nI feel that this is either a caching/minifying etc. or a hosting server-side issue. The provider is rejecting any suggestions, they won’t help&#8230;<br />\nDo you think that your plugin can have anything to do do with this strange phenomenon: a (normally fast) page loading in 1 minute randomly?<br />\nI really appreciate your comment on the issue.<br />\nKind regards,<br />\nRita</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/6LqXcokUI4s\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"ritaantal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wordpress.org/support/topic/random-issue-pages-load-very-slowly-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:149:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;W3 Total Cache breaks GiveWP\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/tnpEi13eEEc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Tue, 08 Oct 2019 03:50:03 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wordpress.org/support/topic/w3-total-cache-breaks-givewp/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:607:\"<p>Replies: 3</p>\n						<p>We use W3 Total Cache on a website and want to implement GiveWP. However, we get a 503 error when logging in or making a donation using GiveWP. Disabling W3 Total Cache fixes this issue.</p>\n<p>Another user with the same issue: <a href=\"https://wordpress.org/support/topic/failure-to-load-success-page/#post-12008408\" rel=\"nofollow\">https://wordpress.org/support/topic/failure-to-load-success-page/#post-12008408</a></p>\n<p>Could you kindly assist us with getting this working?</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/tnpEi13eEEc\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"parrotcreative\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wordpress.org/support/topic/w3-total-cache-breaks-givewp/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:176:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;Page cache disabled 1+ year ago, cached pages appearing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/xxr6lWcYPsQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Mon, 07 Oct 2019 12:34:56 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wordpress.org/support/topic/page-cache-disabled-1-year-ago-cached-pages-appearing/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1043:\"<p>Replies: 3</p>\n						<p>We installed W3TC on a site that is a combination WordPress + custom e-commerce solution. When the site went live we quickly established that page caching was caching the logged in &#8220;My Account&#8221; page (showing a particular user&#8217;s info) so we disabled page caching in W3TC. This was in April 2018. Suddenly today, customers start seeing the cached version of the &#8220;My Account&#8221; page. In WP&#8217;s cache/page_enhanced/ I found the My Account page, exactly as described.</p>\n<p>Question: with page caching disabled, why was WP delivering this cached page? Why suddenly now, after 18 months of no problems?</p>\n<p>I deleted the page_enhanced directory. It appears to have regenerated but is empty now. So the source of the problem has been eliminated. But the incident is troubling.</p>\n<p>Is this just because this is a &#8220;beta&#8221; plugin? I see that it&#8217;s only version 0.10.x.</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/xxr6lWcYPsQ\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"metricmedia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wordpress.org/support/topic/page-cache-disabled-1-year-ago-cached-pages-appearing/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:157:\"&lt;span class=&quot;resolved&quot; aria-label=&quot;Resolved&quot; title=&quot;Topic is resolved.&quot;&gt;&lt;/span&gt;how w3tc handle fbclid Query String?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/1d7yKdHHSCw/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Mon, 07 Oct 2019 11:43:55 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wordpress.org/support/topic/how-w3tc-handle-fbclid-query-string/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:351:\"<p>Replies: 3</p>\n						<p>If a visitor come to my site from facebook with the parameter fbclid (example.com/about-us/?fbclid=something/)</p>\n<p>will w3tc create a new cache file or serve a standard cache file (example.com/about-us/)?</p>\n<p>Thanks</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/1d7yKdHHSCw\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml