ed, the time invariable fixed as 07:00 to 09:00 am. After the five day course, they would consider for joining in Sunday Classes, which are also at the same timings(07:00-09:00am). At Present we have the strength of about  80 students(40 girls and 40 boys) in IYF who are all in the age group of 12 to 18 years and 60 - 70% students attend Sunday Classes regularly.</p><p>Four Pillars of Happiness of A Home :</p><ol><li><strong>​Mercy   ( Mercy is Destroyed by Meat,Fish and Egg Eating )</strong></li><li><strong>Austerity ( Austerity is Destroyed by Intoxication )</strong></li><li><strong>Truthfulness ( Truthfulness is Destroyed by Gambling )</strong></li><li><strong>Purity ( Purity is Destroyed by Illicit Sex )</strong></li></ol><p><strong>Note : Please Donot Indulge In These Sinful Activities ( They Simply Destroy A Happy Home )</strong></p>\";s:15:\"h_alignment_css\";a:1:{s:7:\"desktop\";s:7:\"justify\";}}}}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:1;a:5:{s:2:\"id\";s:14:\"before_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:2;a:5:{s:2:\"id\";s:13:\"after_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:3;a:5:{s:2:\"id\";s:8:\"loop_end\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:4;a:5:{s:2:\"id\";s:19:\"nimble_local_header\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:5;a:5:{s:2:\"id\";s:19:\"nimble_local_footer\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:6;a:5:{s:2:\"id\";s:17:\"__before_featured\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:7;a:5:{s:2:\"id\";s:16:\"__afte