            \"padding-bottom\": \"40\"\n                                        },\n                                        \"tablet\": [],\n                                        \"mobile\": []\n                                    }\n                                }\n                            },\n                            \"ver_ini\": \"1.9.2\"\n                        },\n                        {\n                            \"id\": \"__nimble__d0f316197a72\",\n                            \"level\": \"section\",\n                            \"collection\": [\n                                {\n                                    \"id\": \"__nimble__91fc156f3590\",\n                                    \"level\": \"column\",\n                                    \"collection\": [\n                                        {\n                                            \"id\": \"__nimble__222581b1336d\",\n                                            \"level\": \"module\",\n                                            \"module_type\": \"czr_tiny_mce_editor_module\",\n                                            \"ver_ini\": \"1.9.4\",\n                                            \"value\": {\n                                                \"main_settings\": {\n                                                    \"content\": \"<p>Now it has spread all over the world with more than 700 branches/ centres.Name a country you are sure to find a temple \\u00a0of ISKCON ! IYF\\u00a0- Iskcon Youth Forum is the youth wing of ISKCON\\u00a0and at Vrindavan the sacred place of Radha-Krishna Nitya Leela, this forum is working hard to train the brajavasi youth in the development of Krishna Consciousness as per the principles and guidelines set by \\u00a0Srila Prabhupada.</p><p>\\u00a0</p><h3>How is IYF contributing to prevent the\\u00a0Youth from indulging in bad acts?</h3><p>We go to schools and colleges and meet the authorities concerned and request them to permit for \\u00a0giving presentation on Prabhupada, who changed many many addicted individuals in the whole world. After the permission, we give the Power Point Presentation with videos and nice photos, to the students for about an hour. At the end we ask questions based on what has been discussed and give Prabhupada\'s Books as gifts to those who answered correctly. We request the students \\u00a0to understand the ill-effcets of the four most sinful activities. We request those interested to attend the Five Day Course at the temple, designed for the youth, based on Prabhupada\'s books. Students prefer to have the course before going to school because prasadam is also included, the time invariable fixed as 07:00 to 09:00 am. After the five day course, they would consider for joining in Sunday Classes, which are also at the same timings(07:00-09:00am). At Present we have the strength of about \\u00a080 students(40 girls and 40 boys) in IYF who are all in the age group of 12 to 18 years and 60 - 70% students attend Sunday Classes regularly.</p><p>Four Pillars of Happiness of A Home :</p><ol><li><strong>\\u200bMercy\\u00a0 \\u00a0(\\u00a0Mercy is Destroyed by Meat,Fish and Egg Eating )</strong></li><li><strong>Austerity (\\u00a0Austerity is Destroyed by Intoxication )</strong></li><li><strong>Truthfulness ( Truthfulness is Destroyed by Gambling )</strong></li><li><strong>Purity ( Purity is Destroyed by Illicit Sex )</strong></li></ol><p><strong>Note : Please Donot Indulge In These Sinful Activities ( They Simply Destroy A Happy Home )</strong></p><p>\\u00a0</p><p>\\u00a0</p>\"\n                                                }\n                                            }\n                                        }\n                                    ],\n                                    \"ver_ini\": \"1.9.4\"\n                                }\n                            ],\n                            \"ver_ini\": \"1.9.4\"\n                        }\n                    ],\n       