e  of ISKCON ! IYF - Iskcon Youth Forum is the youth wing of ISKCON and at Vrindavan the sacred place of Radha-Krishna Nitya Leela, this forum is working hard to train the brajavasi youth in the development of Krishna Consciousness as per the principles and guidelines set by  Srila Prabhupada.</p><h3>How is IYF contributing to prevent the Youth from indulging in bad acts?</h3><p>We go to schools and colleges and meet the authorities concerned and request them to permit for  giving presentation on Prabhupada, who changed many many addicted individuals in the whole world. After the permission, we give the Power Point Presentation with videos and nice photos, to the students for about an hour. At the end we ask questions based on what has been discussed and give Prabhupada\'s Books as gifts to those who answered correctly. We request the students  to understand the ill-effcets of the four most sinful activities. We request those interested to attend the Five Day Course at the temple, designed for the youth, based on Prabhupada\'s books. Students prefer to have the course before going to school because prasadam is also included, the time invariable fixed as 07:00 to 09:00 am. After the five day course, they would consider for joining in Sunday Classes, which are also at the same timings(07:00-09:00am). At Present we have the strength of about  80 students(40 girls and 40 boys) in IYF who are all in the age group of 12 to 18 years and 60 - 70% students attend Sunday Classes regularly.</p><p>Four Pillars of Happiness of A Home :</p><ol><li><strong>​Mercy   ( Mercy is Destroyed by Meat,Fish and Egg Eating )</strong></li><li><strong>Austerity ( Austerity is Destroyed by Intoxication )</strong></li><li><strong>Truthfulness ( Truthfulness is Destroyed by Gambling )</strong></li><li><strong>Purity ( Purity is Destroyed by Illicit Sex )</strong></li></ol><p><strong>Note : Please Donot Indulge In These Sinful Activities ( They Simply Destroy A Happy Home )</strong></p>\";}}}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:1;a:5:{s:2:\"id\";s:14:\"before_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:2;a:5:{s:2:\"id\";s:13:\"after_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:3;a:5:{s:2:\"id\";s:8:\"loop_end\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:4;a:5:{s:2:\"id\";s:19:\"nimble_local_header\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:5;a:5:{s:2:\"id\";s:19:\"nimble_local_footer\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:6;a:5:{s:2:\"id\";s:17:\"__before_featured\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:7;a:5:{s:2:\"id\";s:16:\"__after_featured\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}}s:13:\"local_options\";a:0:{}s:5:\"fonts\";a:2:{i:0;s:18:\"[gfont]Raleway:800\";i:1;s:21:\"[gfont]Roboto:regular\";}}', 'nimble___skp__post_page_24', '', 'inherit', 'closed', 'closed', '', '28-revision-v1', '', '', '2019-10-20 07:09:50', '2019-10-20 07:09:50', '', 28, 'http://localhost/iskcon-yuth-fourm/2019/10/20/28-revision-v1/', 0, 'revision', '', 0),
