l Society for Krishna Consciousness was established in 1966 in New York by Srila Prabupada. </p>\";s:15:\"h_alignment_css\";a:2:{s:7:\"desktop\";s:4:\"left\";s:6:\"mobile\";s:7:\"justify\";}}s:13:\"font_settings\";a:3:{s:15:\"font_family_css\";s:21:\"[gfont]Roboto:regular\";s:9:\"color_css\";s:7:\"#898888\";s:15:\"font_weight_css\";s:3:\"500\";}}}}s:7:\"ver_ini\";s:5:\"1.9.2\";s:7:\"options\";a:3:{s:7:\"spacing\";a:1:{s:8:\"pad_marg\";a:3:{s:7:\"desktop\";a:4:{s:12:\"padding-left\";s:2:\"15\";s:14:\"padding-bottom\";s:2:\"94\";s:11:\"padding-top\";s:2:\"90\";s:13:\"padding-right\";s:3:\"150\";}s:6:\"mobile\";a:4:{s:12:\"padding-left\";s:2:\"10\";s:13:\"padding-right\";s:2:\"10\";s:14:\"padding-bottom\";s:2:\"30\";s:11:\"padding-top\";s:2:\"30\";}s:6:\"tablet\";a:1:{s:13:\"padding-right\";s:2:\"20\";}}}s:5:\"width\";a:1:{s:12:\"custom-width\";d:65.694;}s:6:\"height\";a:1:{s:11:\"v_alignment\";a:1:{s:7:\"desktop\";s:3:\"top\";}}}}}s:7:\"options\";a:5:{s:2:\"bg\";a:2:{s:11:\"bg-position\";a:3:{s:7:\"desktop\";s:3:\"top\";s:6:\"tablet\";s:8:\"top_left\";s:6:\"mobile\";s:6:\"center\";}s:16:\"bg-apply-overlay\";b:1;}s:5:\"width\";a:1:{s:19:\"inner-section-width\";a:2:{s:7:\"desktop\";s:5:\"960px\";s:6:\"tablet\";s:4:\"960%\";}}s:10:\"breakpoint\";a:2:{s:21:\"use-custom-breakpoint\";b:1;s:17:\"custom-breakpoint\";s:3:\"575\";}s:7:\"spacing\";a:1:{s:8:\"pad_marg\";a:3:{s:7:\"desktop\";a:2:{s:11:\"padding-top\";s:2:\"50\";s:14:\"padding-bottom\";s:2:\"40\";}s:6:\"tablet\";a:0:{}s:6:\"mobile\";a:0:{}}}s:6:\"height\";a:1:{s:11:\"v_alignment\";a:1:{s:7:\"desktop\";s:3:\"top\";}}}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:1;a:4:{s:2:\"id\";s:22:\"__nimble__d0f316197a72\";s:5:\"level\";s:7:\"section\";s:10:\"collection\";a:1:{i:0;a:4:{s:2:\"id\";s:22:\"__nimble__91fc156f3590\";s:5:\"level\";s:6:\"column\";s:10:\"collection\";a:1:{i:0;a:5:{s:2:\"id\";s:22:\"__nimble__222581b1336d\";s:5:\"level\";s:6:\"module\";s:11:\"module_type\";s:26:\"czr_tiny_mce_editor_module\";s:7:\"ver_ini\";s:5:\"1.9.4\";s:5:\"value\";a:1:{s:13:\"main_settings\";a:2:{s:7:\"content\";s:2122:\"<p>Now it has spread all over the world with more than 700 branches/ centres.Name a country you are sure to find a temple  of ISKCON ! IYF - Iskcon Youth Forum is the youth wing of ISKCON and at Vrindavan the sacred place of Radha-Krishna Nitya Leela, this forum is working hard to train the brajavasi youth in the development of Krishna Consciousness as per the principles and guidelines set by  Srila Prabhupada.</p><h3>How is IYF contributing to prevent the Youth from indulging in bad acts?</h3><p>We go to schools and colleges and meet the authorities concerned and request them to permit for  giving presentation on Prabhupada, who changed many many addicted individuals in the whole world. After the permission, we give the Power Point Presentation with videos and nice photos, to the students for about an hour. At the end we ask questions based on what has been discussed and give Prabhupada\'s Books as gifts to those who answered correctly. We request the students  to understand the ill-effcets of the four most sinful activities. We request those interested to attend the Five Day Course at the temple, designed for the youth, based on Prabhupada\'s books. Students prefer to have the course before going to school because prasadam is also included, the time invariable fixed as 07:00 to 09:00 am. After the five day course, they would consider for joining in Sunday Classes, which are also at the same timings(07:00-09:00am). At Present we have the strength of about  80 students(40 girls and 40 boys) in IYF who are all in the age group of 12 to 18 years and 60 - 70% students attend Sunday Classes regularly.</p><p>Four Pillars of Happiness of A Home :</p><ol><li><strong>​Mercy   ( Mercy is Destroyed by Meat,Fish and Egg Eating )</strong></li><li><strong>Austerity ( Austerity is Destroyed by Intoxication )</strong></li><li><strong>Truthfulness ( Truthfulness is Destroyed by Gambling )</strong></li><li><strong>Purity ( Purity is Destroyed by Illicit Sex )</strong></li></ol><p><strong>Note : Please Donot Indulge In These Sinful Activities ( They Simply Destroy A Happy Home )</strong></p>\";s:15:\"h_alignment_css\";a:1:{s:7:\"desktop\";s:7:\"justify\";}}}}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"ver_ini\";s:5:\"1.9.4\";}}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:1;a:5:{s:2:\"id\";s:14:\"before_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:2;a:5:{s:2:\"id\";s:13:\"after_content\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:3;a:5:{s:2:\"id\";s:8:\"loop_end\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:4;a:5:{s:2:\"id\";s:19:\"nimble_local_header\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:5;a:5:{s:2:\"id\";s:19:\"nimble_local_footer\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:6;a:5:{s:2:\"id\";s:17:\"__before_featured\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}i:7;a:5:{s:2:\"id\";s:16:\"__after_featured\";s:5:\"level\";s:8:\"location\";s:10:\"collection\";a:0:{}s:7:\"options\";a:0:{}s:7:\"ver_ini\";s:5:\"1.9.2\";}}s:13:\"local_options\";a:0:{}s:5:\"fonts\";a:2:{i:0;s:18:\"[gfont]Raleway:800\";i:1;s:21:\"[gfont]Roboto:regular\";}}', 'nimble___skp__post_page_24', '', 'inherit', 'closed', 'closed', '', '28-revision-v1', '', '', '2019-10-20 07:11:50', '2019-10-20 07:11:50', '', 28, 'http://localhost/iskcon-yuth-fourm/2019/10/20/28-revision-v1/', 0, 'revision', '', 0),
